using System;
using System.Collections;
using System.Collections.Generic;
using System.Text;
using SQLite;
using Xamarin.Forms;

namespace LIP
{
    public class DataAccess
    {
        SQLiteConnection dbConn;
        public DataAccess()
        {
            
            dbConn = DependencyService.Get<ISQLite>().GetConnection();
            // create the table(s)
            if (!ExistObject("Productos")) {
                dbConn.CreateTable<Productos>();
                this.Insertmassive();
            }
            if (!ExistObject("Auth"))
            {
                dbConn.CreateTable<Entidades.Auth>();
            }
        }
        public List<Productos> GetAllProd()
        {
            return dbConn.Query<Productos>("Select * From [Productos]");
        }

        public int EjecutarQueryScalar(string Query) {
            return dbConn.ExecuteScalar<int>(Query);
        }

        public List<Productos> FindProductos(string busqueda)
        {
            return dbConn.Query<Productos>("Select * From [Productos] Where UPPER(Nombre) LIKE '" + busqueda + "%'");
        }
        public int SaveProd(Productos aProducto)
        {
            return dbConn.Insert(aProducto);
        }
        public int DeleteProd(Productos aProducto)
        {
            return dbConn.Delete(aProducto);
        }
        public int EditProd(Productos aProducto)
        {
            return dbConn.Update(aProducto);
        }

        public int NumeroRegistros() {

            return dbConn.ExecuteScalar<int>("SELECT COUNT(Codigo) FROM [Productos]");
        }

