        public Boolean ExistObject(string Table) {
            Boolean resp = new Boolean();
            try
            {
                 var r = dbConn.Query<int>(string.Format("SELECT COUNT(name) FROM sqlite_master WHERE TYPE = 'table' AND Name='{0}' ", Table));
                if (dbConn.ExecuteScalar<int>(string.Format("SELECT COUNT(name)  FROM sqlite_master WHERE TYPE = 'table' AND Name='{0}' ", Table)) == 1)
                {
                    resp = true;
                }
                return resp;
            }
            catch (Exception)
            {
                return resp;
                throw;
            }

        }

